import * as React from 'react';
import Table from '@mui/material/Table';
import TableBody from '@mui/material/TableBody';
import TableCell from '@mui/material/TableCell';
import TableContainer from '@mui/material/TableContainer';
import TableHead from '@mui/material/TableHead';
import TableRow from '@mui/material/TableRow';
import Paper from '@mui/material/Paper';
import Button from '@mui/material/Button';

const rows = [
  { name: 'Mannkind', symbol: 'MNKD', price: '$4.50', change: '▲ 0.2%', score: 79 },
  { name: 'Blackstone', symbol: 'BX', price: '$118.92', change: '▼ 0.7%', score: 78 },
  { name: 'Pliant Therapeutics', symbol: 'PLRX', price: '$11.18', change: '▼ 2.9%', score: 76 },
  { name: 'Texas Pacific Land', symbol: 'TPL', price: '$747.09', change: '▲ 3.3%', score: 76 },
];

function BasicTable() {
  return (
    <TableContainer component={Paper}>
      <Table sx={{ minWidth: 650 }} aria-label="simple table">
        <TableHead>
          <TableRow>
            <TableCell>Company</TableCell>
            <TableCell align="right">Price</TableCell>
            <TableCell align="right">AI Score</TableCell>
            <TableCell align="right">AI Analysis</TableCell>
            <TableCell align="right">Add to Portfolio</TableCell>
          </TableRow>
        </TableHead>
        <TableBody>
          {rows.map((row) => (
            <TableRow
              key={row.name}
              sx={{ '&:last-child td, &:last-child th': { border: 0 } }}
            >
              <TableCell component="th" scope="row">
                {row.name}
              </TableCell>
              <TableCell align="right">{row.price}</TableCell>
              <TableCell align="right">{row.score}</TableCell>
              <TableCell align="right">
                <Button variant="contained" color="primary">Generate</Button>
              </TableCell>
              <TableCell align="right">
                <Button variant="outlined" color="primary">Add</Button>
              </TableCell>
            </TableRow>
          ))}
        </TableBody>
      </Table>
    </TableContainer>
  );
}

export default BasicTable;
